function getProducts(button){
  if(!button.classList.contains('_hold')){
    button.classList.add('_hold')
    
    var url = "./file-examplee.xlsx";
    /* set up XMLHttpRequest */
    
    var oReq = new XMLHttpRequest();
    oReq.open("GET", url, true);
    oReq.responseType = "arraybuffer";
    
    oReq.onload = function(e) {
      var arraybuffer = oReq.response;
    
      /* convert data to binary string */
      var data = new Uint8Array(arraybuffer);
      var arr = new Array();
      for(var i = 0; i != data.length; ++i) arr[i] = String.fromCharCode(data[i]);
      var bstr = arr.join("");
    
      /* Call XLSX */
      var workbook = XLSX.read(bstr, {type:"binary"});
    
      /* DO SOMETHING WITH workbook HERE */
      var first_sheet_name = workbook.SheetNames[0];
      /* Get worksheet */
      var worksheet = workbook.Sheets[first_sheet_name];
      var jsonResult = XLSX.utils.sheet_to_json(worksheet,{raw:true})
      console.log(jsonResult);
      loadProducts(jsonResult)
      button.classList.remove('_hold')
      button.remove()
    }
    oReq.send();
}}

function loadProducts(data){
  const ProductsItems  = document.querySelector('.products__items');
  data.forEach(item=>{
    const productId = item.id;
    const productUrl = item.url;
    const productImage = item.image;
    const productTitle = item.title;
    const productText = item.text;
    const productPrice = item.price;
    const productOldPrice = item.priceOld;
    const productShareUrl = item.shareUrl;
    const productLikeUrl = item.likeUrl;
    const productLabelstype = item.labelstype;
    const productLabelsvalue = item.labelsvalue;


      let productTemplateStart = `<article data-pid='${productId}' class="products__item item-product">`;
      let productsTempaleEnd = ` </article>`

      let productsTempaleLabels = '';
      if (productLabelstype){
        let productsTemplateLabelsStart = `<div class="item-product__labels">`
        let productsTemplateLabelsEnd = `</div>`;
        let productsTemplateLabelsContent = '';


        productsTemplateLabelsContent += `<div class="item-product__label item-product__label_${productLabelstype}">${productLabelsvalue}</div>;`
        
        productsTempaleLabels += productsTemplateLabelsStart
        productsTempaleLabels += productsTemplateLabelsContent
        productsTempaleLabels += productsTemplateLabelsEnd
      }

      let productsTemplateImage = `
      <a href="${productUrl}" class="item-product__image _ibg">
        <img src="${productImage}" alt="${productTitle}">
      </a>
    `;
      let productsTemplateBodyStart = `<div class="item-product__body">`;
      let productsTemplateBodyEnd = `</div>`;
      

      let productsTemplateContent = `
      <div class="item-product__content">
      <h5 class="item-product__title">${productTitle}</h5>
      <div class="item-product__text">${productText}</div>
  </div>`;

      let productsTemplatePrices = '';
      let productsTemplatePricesStart = `<div class="item-product__prices">`;
      let productsTemplatePricesCurrent = `<div class="item-product__price">${productPrice}"</div>`;
      let productsTemplatePricesOld = `<div class="item-product__price item-product__price_old">${productOldPrice}</div>`
      let productsTemplatePricesEnd = `</div>`;

      productsTemplatePrices = productsTemplatePricesStart;
      productsTemplatePrices += productsTemplatePricesCurrent;
      if (productOldPrice){
        productsTemplatePrices += productsTemplatePricesOld
      }
      productsTemplatePrices += productsTemplatePricesEnd;

      let prodproductsTemplateActions =`
      <div class="item-product__actions actions-product">
      <div class="actions-product__body">
          <a href="" class="actions-product__button btn btn_white">Add to cart</a>
          <a href="${productShareUrl}" class="actions-product__link _icon-share">Share</a>
          <a href="${productLikeUrl}" class="actions-product__link _icon-heart">Like</a>
          <img class="fly-image" src="./image/heart.png" alt="">
      </div>
  </div>
  `;
      let prodproductsTemplateBody = '';
      prodproductsTemplateBody +=productsTemplateBodyStart;
      prodproductsTemplateBody +=productsTemplateContent;
      prodproductsTemplateBody +=productsTemplatePrices;
      prodproductsTemplateBody +=prodproductsTemplateActions;
      prodproductsTemplateBody +=productsTemplateBodyEnd;

      let productsTemplate = '';
      productsTemplate += productTemplateStart
      productsTemplate += productsTempaleLabels
      productsTemplate += productsTemplateImage
      productsTemplate += prodproductsTemplateBody
      productsTemplate += productsTempaleEnd
      
      ProductsItems.insertAdjacentHTML('beforeend',productsTemplate)
    });
};

